export const topicApi = async (id) => {
    const response = await fetch(`http://localhost:3000/topics`);
    const result = await response.json();
    return result;
}
export const questionApi = async (topics) => {
    const response = await fetch(`http://localhost:3000/question/${topics}`);
    const result = await response.json();
    return result;
}
